import React from "react";
import { Link } from "react-router-dom";
// reactstrap components
import {
  Button,
  NavItem,
  NavLink,
  Nav,
  Container,
  Row,
  Col,
  UncontrolledTooltip
} from "reactstrap";

class Footer extends React.Component {
  render() {
    return (
      <footer className="footer">
        <Container>
          <Row>
            <Col md="5">
              <h1 className="title">Pramod Gobburi</h1>
            </Col>
          </Row>
        </Container>
      </footer>
    );
  }
}

export default Footer;
